import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom'; // Importa el enrutador si es necesario
import App from './App'; // Importa el componente principal de tu aplicación

function Home() {
    return (
        <div className="App">
            <Router>
                <PublicNavBar />
            </Router>
            <Route path="/" exact component={Home} />
            <Route path="/soporte" component={Support} />
            <Route path="/preguntas-frecuentes" component={Faq} />
        </div>
    );
}

export default Home;
